import React from "react";

function TaskCard(props) {
  return (
    <>
      <li
        key={props.task.id}
        className={props.task.completed ? "completed" : "incomplete"}
      >
        <span>
          {task.id} - {task.name}
        </span>
        <button onClick={() => handleDelete(props.task.id)} className="delete">
          Delete
        </button>
      </li>
    </>
  );
}

export default TaskCard;
